import React from 'react';
import PropTypes from 'prop-types';

// Styling
import { Box, Text } from '../styles';
import SFooter from './styles';

const Footer = ({ menus }) => <SFooter as="footer">Hoi</SFooter>;

Footer.defaultProps = {
  menus: false,
};

export default Footer;
